import React from "react";
import "./search.css";

export default function Search() {
  return (
    <div className="container">
      <form className="search-form">
        <div className="input-group">
          <input type="text" placeholder="Search..." />
          <button type="submit">Search</button>
        </div>
      </form>
    </div>
  );
}




